import React from 'react'
import DataDiri from '../components/form-formik/dataDiri'
import DataAlamat from '../components/form-formik/dataAlamat';
import { connect } from "react-redux";

const checkStepForm = (params) => {
  switch (params) {
    case 1:
      return <DataDiri />

    case 2:
      return <DataAlamat />

    default:
      return null
  }
}

function login(props) {
  return (
    <div>
    {checkStepForm(props.step)}
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    step: state.formReducer.step
  }
}

export default loginq
